import { useForm } from "react-hook-form";
import React from "react";
import { Link } from "react-router-dom";

const Browse = () => {
    const paperStyle={ padding: '50px 20px', width:300, margin:"20px auto"}
    return(
        <div className="browse">
            <h1 style={{fontSize: 45, fontWeight:"lighter"}}>Webform Collection</h1>
            <h3 style={{fontWeight:"lighter"}}>Browse our entire library of user-generated webforms.</h3>
            <br /><Link to="/">
                Go Back
                </Link>
        </div>
        
    );
}

export default Browse
